import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '@fortawesome/fontawesome-free/css/all.min.css';
import { Menu, LogOut, FileText, ChevronLeft } from 'lucide-react';

const initialExamData = [
  { id: "0001", lembaga: "SMKN 1 SURABAYA", jumlahPeserta: 100, tanggal: "01/03/24" },
  { id: "0002", lembaga: "SMKN 2 SURABAYA", jumlahPeserta: 115, tanggal: "01/03/24" },
  { id: "0003", lembaga: "SMKN 3 SURABAYA", jumlahPeserta: 102, tanggal: "01/03/24" },
  { id: "0004", lembaga: "SMKN 4 SURABAYA", jumlahPeserta: 105, tanggal: "01/03/24" },
  { id: "0005", lembaga: "SMKN 5 SURABAYA", jumlahPeserta: 97, tanggal: "01/03/24" },
  { id: "0006", lembaga: "SMKN 6 SURABAYA", jumlahPeserta: 110, tanggal: "10/05/24" },
  { id: "0007", lembaga: "SMKN 7 SURABAYA", jumlahPeserta: 100, tanggal: "10/05/24" },
  { id: "0008", lembaga: "SMKN 8 SURABAYA", jumlahPeserta: 108, tanggal: "10/05/24" },
  { id: "0009", lembaga: "SMKN 9 SURABAYA", jumlahPeserta: 119, tanggal: "10/05/24" },
  { id: "0010", lembaga: "SMKN 10 SURABAYA", jumlahPeserta: 102, tanggal: "10/05/24" },
];

export function Ujian() {
  const [isOpen, setIsOpen] = useState(true);
  const [examData, setExamData] = useState(initialExamData);
  const [statuses, setStatuses] = useState(examData.reduce((acc, exam) => ({ ...acc, [exam.id]: false }), {}));
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [formData, setFormData] = useState({ nama: '', tanggal: '', status: false, subjects: '' });

  const toggleSidebar = () => {
    setIsOpen(!isOpen);
  };

  const handleStatusChange = (id) => {
    setStatuses(prev => ({ ...prev, [id]: !prev[id] }));
  };

  const toggleModal = () => {
    setIsModalOpen(!isModalOpen);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const newExam = {
      id: (examData.length + 1).toString().padStart(4, '0'),
      lembaga: formData.nama,
      jumlahPeserta: 0, // default value
      tanggal: formData.tanggal,
    };
    setExamData([...examData, newExam]);
    setFormData({ nama: '', tanggal: '', status: false, subjects: '' });
    toggleModal();
  };

  return (
    <div className={`h-screen bg-white text-gray-900 flex`}>
      <nav className={`flex flex-col transition-all duration-300 ease-in-out ${isOpen ? 'w-64' : 'w-16'} bg-blue-400 rounded-r-2xl`}>
        <button className="w-full py-3 px-4 flex items-center justify-between hover:bg-blue-300 transition-colors duration-200" onClick={toggleSidebar}>
          <div className="flex items-center">
            <Menu className="w-6 h-6 mr-3 text-white" /> {isOpen && <span className="text-lg font-medium text-white">Menu</span>}
          </div>
          {isOpen && <ChevronLeft className="w-5 h-5 text-white" />}
        </button>

        <Link to="/soal" className="w-full py-3 px-4 flex items-center hover:bg-blue-300 transition-colors duration-200">
          <FileText className="w-6 h-6 mr-3 text-white" />
          {isOpen && <span className="text-white">Soal</span>}
        </Link>

        <div className="mt-auto">
          <Link to="/registration" className="w-full py-3 px-4 flex items-center hover:bg-blue-300 transition-colors duration-200">
            <LogOut className="w-6 h-6 mr-3 text-white" />
            {isOpen && <span className="text-white">Logout</span>}
          </Link>
        </div>
      </nav>

      <div className="flex-1 p-6">
        <button onClick={toggleModal} className="mb-4 bg-blue-500 text-white px-4 py-2 rounded-md">Tambah Ujian</button>
        <div className="overflow-x-auto">
          <table className="min-w-full bg-white border border-gray-200 rounded-lg overflow-hidden">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Status</th>
                <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">ID Ujian</th>
                <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Lembaga</th>
                <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Jumlah Peserta</th>
                <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Tanggal</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {examData.map((exam) => (
                <tr key={exam.id}>
                  <td className="px-4 py-2 whitespace-nowrap">
                    <label className="inline-flex items-center mb-5 cursor-pointer">
                      <input type="checkbox" checked={statuses[exam.id]} onChange={() => handleStatusChange(exam.id)} className="sr-only peer" />
                      <div className={`relative w-11 h-6 ${statuses[exam.id] ? 'bg-blue-600' : 'bg-gray-200'} peer-focus:outline-none peer-focus:ring-4 peer-focus:ring-blue-300 rounded-full peer dark:bg-gray-700 peer-checked:after:translate-x-full rtl:peer-checked:after:-translate-x-full peer-checked:after:border-white after:content-[''] after:absolute after:top-[2px] after:left-[2px] after:bg-white after:border-gray-300 after:border after:rounded-full after:w-5 after:h-5 after:transition-all dark:border-gray-600`}></div>
                    </label>
                  </td>
                  <td className="px-4 py-2 whitespace-nowrap text-sm font-medium text-gray-900">{exam.id}</td>
                  <td className="px-4 py-2 whitespace-nowrap text-sm text-gray-500">{exam.lembaga}</td>
                  <td className="px-4 py-2 whitespace-nowrap text-sm text-gray-500">{exam.jumlahPeserta}</td>
                  <td className="px-4 py-2 whitespace-nowrap text-sm text-gray-500">{exam.tanggal}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {/* Modal */}
        {isModalOpen && (
          <div className="fixed inset-0 bg-gray-600 bg-opacity-50 flex items-center justify-center">
            <div className="bg-white p-6 rounded-md shadow-lg">
              <h2 className="text-xl font-bold mb-4">Tambah Ujian</h2>
              <form onSubmit={handleSubmit}>
                <div className="mb-4">
                  <label htmlFor="nama" className="block text-sm font-medium text-gray-700">Nama Lembaga</label>
                  <input type="text" id="nama" name="nama" value={formData.nama} onChange={handleInputChange} className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm" required />
                </div>
                <div className="mb-4">
                  <label htmlFor="tanggal" className="block text-sm font-medium text-gray-700">Tanggal</label>
                  <input type="date" id="tanggal" name="tanggal" value={formData.tanggal} onChange={handleInputChange} className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm" required />
                </div>
                <div className="flex justify-end">
                  <button type="button" onClick={toggleModal} className="mr-2 px-4 py-2 bg-gray-500 text-white rounded-md">Batal</button>
                  <button type="submit" className="px-4 py-2 bg-blue-500 text-white rounded-md">Tambah</button>
                </div>
              </form>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default Results;
